['#include<stdio.h>
#include<string.h>
int main()
{
    int ts,n,i,j,flag=0;
    char s[110];
    char t[110];
    scanf("%d",&ts);
    while(0<ts)
    {
        flag=0;
        scanf("%s",s);
        scanf("%s",t);
        for(i=0; s[i]!='\0'; i++)
        {
            for(j=0; t[j]!='\0'; j++)
            {
                if(s[i]==t[j])
                {
                    flag=1;
                }
            }
        }
        if(flag==1)
        {
            printf("YES\n");
        }
        else
            printf("NO\n");
        ts--;
    }
    return 0;
}
